import './Navbar.css';

function NavBar(){
    return(
        <nav>
            <ul>
                <li><a href='#'>Home</a></li>
                <li><a href=''>About</a></li>
                <li><a href=''>Skills</a></li>
                <li><a href=''>Experience</a></li>
                <li><a href=''>Contacts</a></li>
            </ul>
        </nav>
    );
}

export default NavBar
